import React from 'react';
import './App.css';

function App() {
  const [text, setText] = React.useState('');

  return (
    <div className='App'>
      <input
        type='text'
        placeholder='Enter Item'
        value={text}
        onChange={(e) => setText(e.target.value)}
      />
      <button>Add Item</button>
    </div>
  );
}

export default App;
